    false,nt"url": null,nt"notes": "The proposed project is a part of the Refuge
    invasive species management program and will help achieve goals and priority habitats
    identified in the Refuge CCP. The project will conduct ED/RR surveys over 1,500
    acres focusing on known species occurrences and those on the southwest Washington/Willamette
    Valley watch lists. Control will be focused primarily on those species which currently
    pose the greatest challenges or are not yet under desired levels of control. Ricefield
    bulrush and shiny geranium are two species that pose a significant risk to Refuge
    habitats and will be the primary focus. Other important species that will be treated
    include yellow flag iris, slenderflower thistle, water primrose willow, fragrant
    water lily, English holly, and poison hemlock. Other target species will be treated
    as opportunity or time permits. All funds would be obligated in FY 16. Majority
    (83%) of the work will take place in FY 16 except for control work on shiny geranium
    (17 %) which would take place during the dormant season Nov-March in FY 17 to improve
    effectiveness and reduce impacts to non-target species.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
